(1053, 0, 'BEDRIJFSPROFIEL', 'bedrijfsprofiel', '<p><strong>History</strong></p>\r\n<p>Four dedicated Danes established Compac in 1946. Their vision was to build superior hydraulic jacks. Our vision is still the same after 60 years in business and we are proud to continue in our efforts to strengthen our reputation for superior quality, which we have built up over the years. The hydraulics factory is still based in the small east coast town of Juelsminde in Jutland, Denmark.</p>\r\n<p><strong>Manufacturing since 1946</strong><br />Compac has been manufacturing high quality hydraulic products since 1946. The aim of the experienced engineering staff at Compac is to ensure excellence in quality and reliability with the key objective of creating satisfied customers.</p>\r\n<p><br /><strong>Excellent raw materials</strong><br />Compac´s hydraulic components are manufactured in-house using high quality materials. Important raw materials like the special hydraulic tubes, seals, pressure balls, valve blocks, etc. are sourced from high quality raw materials suppliers only. There are <span style="text-decoration: underline;">no compromises</span> concerning the quality of the critical raw materials used in Compac´s hydraulic systems.<br /><br /><strong>Unique quality system</strong><br />Compac operates a unique quality system that is inspired be the Japanese quality approach. The stringent quality system combines the quality mind-set and personal responsibility of everyone involved in the manufacturing process.<br /><br /><strong>3 year factory warranty</strong><br />Compac has set a benchmark in the industry by being the only manufacture to offer a full 3 year warranty. No other manufacture of similar products has exceeded or even matched this long warranty. The reason that Compac´s reliability and durability is setting the benchmark in the industry is the unique combination of excellent raw materials, experienced and quality minded workforce and a management system that embraces quality manufacturing.<br /><br /><strong>Solutions</strong><br />Compac aims to design and develop products that provide users with the right features, benefits and specifications necessary to repair modern vehicles.</p>', '', 1, 0, '2012-04-10 03:17:42', 62, '', '2013-04-09 07:28:14', 62, 0, '0000-00-00 00:00:00', '2012-04-10 03:17:42', '0000-00-00 00:00:00', '', '', 'created_by=62\ncreated_by_alias=\naccess=0\ncreated=\npublish_up=\npublish_down=\nshow_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=\n\n', 6, 6, '', '', 1, 0, '', 0, '', ''),
(1055, 0, 'Witamy na Compac Hydraulik', 'witamy-na-compac-hydraulik', '<p><strong>Manufacturer since 1946</strong><br />Compac has been manufacturing high quality hydraulic products since 1946. The aim of the experienced engineering staff at Compac is to ensure excellence in quality and reliability with the key objective of creating satisfied customers.</p>\r\n<p> </p>', '', -2, 0, '2012-04-10 03:19:33', 62, '', '2013-08-22 11:24:11', 62, 0, '0000-00-00 00:00:00', '2012-04-10 03:19:33', '0000-00-00 00:00:00', '', '', 'created_by=62\ncreated_by_alias=\naccess=0\ncreated=\npublish_up=\npublish_down=\nshow_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=\n\n', 10, 4, '', '', 1, 0, '', 0, '', ''),
