(1, '<p>We have the best tools for do-it-yourselfers.  Check us out!</p>\r\n<p>We were established in 1969 in a time when getting good tools was expensive, but the quality was good.  Now that only a select few of those authentic tools survive, we have dedicated this store to bringing the experience alive for collectors and master mechanics everywhere.</p>\r\n<p>You can easily find products selecting the category you would like to browse above.</p>', '<h5>You haven\\''t configured any terms of service yet. Click <a href=\\"administrator/index2.php?page=store.store_form&amp;option=com_virtuemart\\">here</a> to change this text.</h5>', '', '', '<h1>{vm:vendorname}</h1><p>{vm:vendoraddress}</p>', '<p>{vm:vendorlegalinfo}<br />Page {vm:pagenum}/{vm:pagecount}</p>', 'Bruun & Stengade', '+45 44 64 60 90', 'http://bruunogstengade', '', '', '', '', '', '', '', '', 'bruun-stengade');
